import React from "react";
import Rate_Item from '../Python_Folder/Rate_Item'
import {useState,useEffect} from 'react';
function Ratings() {
  function get_data()
  {
    const [data,setData]=useState([]);
  const getData=()=>{
    fetch('https://api.npoint.io/bcf5a1773ffabab319e4'
    ,{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
        setData(myJson)
      });
  }
  useEffect(()=>{
    getData()
  },[])
  }
  return (
    <div>
      <th class="col-7" style={{ fontSize: "24px" }}>
        {" "}
        <i
          class="material-icons"
          style={{ color: "rgb(255, 210, 48)", fontSize: "20px" }}
        >
          star
        </i>
        4.4 course rating{" "}
        <i
          class="material-icons"
          style={{ fontSize: "16px", transform: "rotate(130deg)" }}
        >
          fiber_manual_record
        </i>
        3K ratings
      </th>
      <div class="row">
      {data.map((cur_item)=>{
        return <Rate_Item 
          name = {cur_item.name}
          img = {cur_item.img}
          paragraph = {cur_item.paragraph}
          time = {cur_item.time}
        />
      })}
      </div>
      
    </div>
  );
}

export default Ratings;
